import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom"

import Home from "./pages/Header";
const App = () => {
  return (
  <Router>
    <Link>
    <Switch>
      <Route>
        <Home />
      </Route>
    </Switch>
    </Link>
  </Router>
  )
}

export default App;
